import React, { Component } from 'react';
// import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Footer from './components/footer/footer';
import Notice from './components/notice/notice.component';
import Spinner from './components/spinner/spinner.component';
import TeamList from './components/team-list/team-list.component';
import Sponsors from './components/sponsors/sponsors.component';
import ContactForm from './components/contact-us/contact.component';
import './App.css';

import Navigation from "./components/Navigation"
import Landing from "./components/Landing"
import Create from "./components/Create";

// Version 2

// import Login from "./components/Login"
// import Register from "./components/Register"
// import Profile from "./components/Profile"
// import ProjectsList  from "./components/projects-list.component";
// import Project from "./components/project.component";
// import EditProject from "./components/edit-project.component";
// import CreateUser from "./components/create-user.component";
import { Jumbotron, Button } from 'reactstrap';

class App extends Component {
  render() {
    return (
        <div className="App">
          <Navigation />
          <Jumbotron className="jumbotron">
              <h1 clasName="display-3">ORIGIN2020 - WEB & MOBILE 1ST</h1>
              <p className="lead">Mobile Friendly Web Applications from Static to Dynamic. </p>
              <hr className="my-2" />
              <p>The main Phylosophy behind what Origin2020 stands for is the simple mear fact that it is developed by a proud Tech Enthusiast.</p>
              <p>We Put Contempo in Web Development.</p>
              <p className="lead">
                  <Button color="primary">Connect</Button>
              </p>
          </Jumbotron>
          <br />
          <Notice />
          <br />
          <TeamList />
          <br />
          <Sponsors />
          <br />
          <ContactForm />
          <br />
          <Spinner />
          <br />
          <Footer />
        </div>
    );
  }
}

export default App;
